INSERT INTO `zj_workmate` VALUES ('186', '0', '如何正确教育叛逆期的孩子', '如何正确教育叛逆期的孩子<br/>  【导读】对孩子的逆反，首先应予以接纳，把它视为孩子逐渐成熟的过程。其次，在教育中要深入了解孩子行为或想法的逻辑是怎样的，针对孩子那些不成熟的；或有害于成长的想法，选择给予耐心的指<br/>  <br/>  <br/>  青春期孩子的逆反的确会给孩子们带来一定的危险，但是科学的角度来看，逆反实际上是孩子心理成长的必要阶段。如果孩子不经历逆反期，那么他们就无法长成一个有独立思维能力的成年人，换句话说，太乖的孩子往往会形成依赖性人格，对他们将来的独立生存带来更大的危害。<br/>  如果从成长的角度看逆反，逆反不仅不是坏事而是一件好事。<br/>  青春期之前，孩子是没有自我意识和独立思维能力的，所以任何事情都要依赖于成年人的思考和建议。进入青春期后随着大脑的发育，他们开始有了独立思考和判断的初步能力，因为孩子们发现了自己原来也能像成年人那样找出事情间的逻辑关系，于是他们觉得自己与成人是平等的，他们不再盲目听从别人的意见，要尝试着自己去思考，外在的表现就是固执、对抗成人的意见、一意孤行。其实这是孩子在学习独立思考的过程。<br/>  但是，由于其逻辑思维还在发育中，对问题的认知还处在表面化的程度之上，同时又缺乏生活经验，使他们的思考和判断能力显得很肤浅和幼稚，其分析和选择带有很大的局限性，着眼点常常是当时的快乐而不顾及长远利益。这样的思考和判断导致的行为，对他们的往往具有很大的风险。<br/>  作为家长来说，对孩子的逆反，首先应予以接纳，把它视为孩子逐渐成熟的过程。其次，在教育中要深入了解孩子行为或想法的逻辑是怎样的，针对孩子那些不成熟的；或有害于成长的想法，选择给予耐心的指导，也就是说，即要让他们独立思考和尝试一些她们想要做的事，又要不断的从长远的利益上来分析其判断思考的局限性，扩大他们看问题的视野。<br/>  只要帮助孩子们弄清这样的道理：“现在你的选择的确让你快乐，可是这样的选择还是带有太多孩子式的任性，这样的做法有可能为你的成长带来负面影响，你现在长大了，需要学习成年人的思考方式，为了长远利益要学会用理性控制自己对眼下快乐的需要，只有这样做才能帮助你长成一个真正的成年人。”<br/>  青春期的孩子是很渴望被成人社会所接纳的，就利用他们的这种心理需要来指导他们，指导逆反期的孩子，所使用的态度是很重要的，一定要用平等和尊重的态度来对待他们的想法，无论这些想法有多幼稚，但这毕竟是来自他们独立的思考，在这一点上一定要予以尊重，然后指出其中幼稚的成份，告诉他们怎样做才是成人的态度，教会他们把眼光放远，把心胸放宽。一般说来，经过这样的对比，孩子发现和理解了自己想法中不成熟的地方，他们便会主动调整和按照教师所指导的去做。当然这样做老师们要付出更多的时间和耐心。<br/>  在我们的家庭和学校教育中有一个误区，认为只要给孩子讲清道理，孩子就应该自己能做好，但实际上并不是如此，教育是一项工程，就像盖高楼要一层层的盖，对于孩子的教育是需要一件事一件事去指导，让孩子在这样的指导中逐渐学会掌握和应用正确的思考和判断的的方法。这样的教育即顺应了孩子独立思维的发展，同时也不会因为能力上的缺乏而导致有害于成长的事情发生。<br/>  <br/>  一、那我们怎样和“叛逆”孩子沟通呢？<br/>  打骂不行，放任不得，半大孩子真难管，在许多家长无奈于青春期孩子叛逆的同时，孩子们说出了自己的心里话：“叛逆，是被逼出来的。其实，自己在生活中也很矛盾。”孩子心声：最渴望父母也能认个错“在父母眼里，他们永远都是正确的，我从来就没有对过。”     <br/>  青春期“叛逆”孩子将父母也能勇于承认错误，看成是梦寐以求的事：“我们中，没有几个是真正的坏孩子，关键在父母理解不理解我们。有时候，我们也挺矛盾的，我们知道父母肯定是要孝顺的，但如果‘听话’就是孝顺，即便是父母说错了，我们也要按照他们的意思去做，那活着就真没意思了。为什么做父母就不能有错呢？”<br/>  观点：<br/>  青春期孩子开始独立思考，开始对社会人生有自己的看法，渴望独立和被尊重，但父母不当的管教态度，以及对孩子“隐私”和个性的不尊重等都容易使孩子感到厌恶而产生反抗行为。而父母让孩子提前进入社会，过多地告诉孩子“人间险恶”或者自己“说一套、做一套”，不能以身作则都容易造成孩子的反抗倾向。<br/>  对此，教育专家建议，面对“青春期叛逆”，家长在和孩子相处中，也有“六项注意”。<br/>  1、多关心子女在学校的情形，但不要让孩子有“家长和老师串通一气”的感觉。<br/>  2、孩子进入青春叛逆期后，家长要注意对他们下放各种权利，以帮助孩子从不谙世事向成熟过渡。<br/>  3、避免“你应该”、“你必须”、“你懂什么”诸如此类的“口头禅”。<br/>  4、尊重孩子的隐私权，如果孩子实在不愿同您交流，不必过于强迫，尊重孩子的同时也为自己赢得了尊重。<br/>  5、在与孩子接触时，尽可能多找孩子的优点，并多鼓励，减少孩子对您的抗拒心理。<br/>  6、不要在和孩子交流时总以学习成绩为话题，这样只会让孩子有心理压力怀疑您的“诚意”。<br/>  二、如何帮助孩子顺利度过青春期？<br/>  中学阶段，是孩子成长的关键时期，这就是我们常说的青春期。到了初二，仿佛一夜之间，我们也许会发觉，孩子真的长大了，不再是我们眼里的懵懂少年了。他们变得敏感、叛逆，脾气也大得不得了，一说即跳。一些家长闲聊时，谈到这一点，他们大多无奈地摇头说，孩子进了初中后，就管也管不得了，往往是你一句话还没有说完就发脾气。作为家长我们要关注孩子的成长，在孩子成长的每一个阶段，要试图去了解这个阶段的孩子的心理特征。因为只有这样，才能去理解孩子的行为，才能与她沟通，引导她去走好每一步。当然，每个孩子面临的问题不一样：<br/>  第一、关注孩子的成长过程<br/>  处于青春期的孩子为什么会容易发怒，说话也很偏激？因为这个阶段的孩子正处于身体急剧变化的时期，比如男孩子开始长胡须，声音也变粗了，甚至会有遗精的现象；女孩子乳房开始发育，有了月经。这些变化，对于他们来说，往往是很突然的，假如事先没有准备，他们会惊慌不安，会烦恼，以为自己的身体出了问题，尤其他们不了解别人其实也和他们一样面临同样的烦恼，因而，这种“与众不同”的感觉让他们变得特别敏感，也特别自卑。<br/>  作为家长，要很早就告诉孩子这些常识，让孩子能从容应对，情绪上的波动相对也少些。同时也可以让自己的孩子看一些这方面的书。例如：美国学者詹姆斯•杜布森博士写的：《预备青春期》和《正当青春期》。这两本书家长应该和孩子一道来读。<br/>  读完这两本书，家长大致就可以知道青春期的孩子面对哪些困惑，然后，对照自己的孩子来想一想自己该怎么做。除了孩子自身的困惑外，家长们还应该主动和孩子谈一谈性，谈一谈爱情，告诉孩子一些他需要掌握的科普知识。因为你不谈，孩子也多的是地方去了解这些信息，比如网络，比如现在很流行的一些校园文学，还有手机短信，不健康的信息多的是渠道！而这样得来的信息往往会贻误孩子。有的家长可能听说过，现在就有中学生在网上结婚，而且为数还不少！所以，家长不去争取孩子，网络、影视等传媒就会把孩子争取过去！<br/>  第二，培养孩子的自信心<br/>  帮你的孩子确定学习目标时，一定要先看看他的现状和他的潜能，尤其对于那些目前成绩不是很理想的孩子比较切合实际的办法是，你可以帮孩子制定一个分阶段的学习目标。这个目标要以他现在的成绩为基点。假如他这次只考了50分，那么，你最好不要期望他一下子可以升到80分或90分，当然这样的奇迹也可能会发生，但不论怎样，我们的期望值不妨低一点，比如说他下次及格了，你就可以奖励了。这样对于孩子的压力小一些，而且当他的成绩大大出乎我们意料地好时，我们可以和孩子一道分享这难得的喜悦！而这，更能增强他的自信心。<br/>  第三、给孩子一个笑脸<br/>  不要把工作或者工作以外的不愉悦的心情带回家。即使自己在外面多么的不如意，也要记得在进门之前提醒自己：调整好心态，当孩子开门迎接你的时候，给她一个笑脸。这点很重要。让孩子看到笑容满面你，其实也减轻了她的心理压力，让她觉得你很容易接近，这样一来，她对你就少了一份戒备心理和抵触情绪，有话也愿意和你说。<br/>  青春期的孩子，在这个年龄段都有倾诉的欲望，家长们最好做一个认真一点的听众，因为这表明你重视他，这种倾听本身就是对他的一种安慰。否则，他会觉得受到冷落。受到冷落怎么办？到外面去找能安慰他的人。为什么有的小孩子会结交不良少年，会早恋？原因当然很多，但其中根本的一点，就是缺少家庭的关怀，缺少亲情的温暖。<br/>  第四、多陪陪你的孩子<br/>  现在的独生子女，都很孤单，缺少玩伴，所以，做父母的就又多了一个任务，陪孩子玩，经常和她一起去选择适合她读的书籍，和她一道上网，和她一道玩扑克牌，一道搞运动。在 这个过程中，家长又可以了解她的好恶，并适时引导她。多陪陪你的孩子，陪他玩，陪他说说话，也许他就不会到虚幻的世界里去寻找精神的寄托了。<br/>  第五、了解你的孩子，信任你的孩子<br/>  孩子长大了，更重视自己的隐私权，有些家长偷看了孩子的日记，发现了孩子的一些秘密，就沉不住气，勃然大怒。这是最不明智教育孩子的方法。假如你觉得你只能通过查看孩子的日记来了解孩子在想什么，那当然也未尝不可，但最好不要动怒，要让自己冷静下来，分析一下其中的原因，想一想应对的办法。而最主要的一点是不要让孩子知道你看了她不让看的东西。否则，容易让她对你产生信任危机，产生逆反心理。     <br/>  一般最好是通过平常的闲聊来了解孩子心里的一些想法。比如：在上街的时候，搂着她或牵着她的手，和她边走边说话。这样可以从谈话中了解孩子的思想和梦想，或许孩子的每个阶段的梦想都不一样，但不管这些梦想是什么，家长都要鼓励她为实现梦想而努力，努力才有回报。要给孩子自由的时间，或者给她规定玩耍的时间，让她学会遵守你们之间的规定，偶尔违规，就要实行制裁。因为这样可以让她明白这一点：信任是用来投资的，不是用来透支的。投资就有丰厚的回报，而如果透支的话，迟早有一天会变成穷光旦一个，而且再也没有人会信任她。 <br/>  作为家长一定要做到：让你的孩子爱你，愿意接近你；而不是怕你，刻意疏远你！<br/>  <br/>  ', '[{\"litpic\":\"\\/Uploads\\/img\\/20160307\\/145733610638107.png\",\"height\":0,\"width\":0}]', '/Uploads/img/20160307/145733610638107.png', '北京市', '1457336106', '0', '2', 'http://');
