INSERT INTO `zj_workmate` VALUES ('168', '0', '孩子的教育，能做的其实有很多', '孩子的教育，能做的其实有很多<br/>      广大建筑工兄弟常常在子女教育问题上面临诸多问题：有的离家太远，只能让父母带孩子；有的学习上的事帮不上忙，只能完全交给学校；有的不知道怎么教导，沿袭棍棒孝子的观念；还有的觉得自己努力赚钱就够了，干脆不管不顾。种种问题既反映建工子女教育上的问题，又体现出广大建筑工兄弟在子女教育上种种无奈……<br/>      为人父、为人母？哪个不希望自己的孩子有一个好的未来？出去打拼不就是为了下一代吗？但是由于自身知识水平不高、与孩子沟通较少等种种条件的制约，导致对孩子的教育不能起到很好的效果。如何能够改变这一现状便成了当下子女教育亟待解决的问题。<br/>      别吝啬对孩子的关怀<br/>      外出打工没法见面能理解，白天干活太累也能理解。但这都不会是阻碍你表达对孩子关怀的问题。往家里打电话或者回家的时候不要只问成绩怎么样，多问问孩子的感受。把“怎么才考这点分”换成“最近是不是有心事”会起到更好的效果。每次交流的时间再短，一句关怀的话也不会费太多精力，把关怀表达出来会让孩子体会更多的温暖。<br/>      其实就算不会孩子学习的内容，也可以做很多事。<br/>      很多建筑工家长把不管孩子学习原因归咎到自己也不会上。不得不承认这看似是一个合理的解释，但绝对不能是在孩子学习问题上不作为的理由。即使自己不会，还是有很多事情可以做的。晚上回家询问一下孩子作业完成情况可能是很多建工家长都会做的事，但不要问完了事。拿过作业看一眼，问问哪道题不会，给孩子圈起来让他明天问老师，让老师讲完就在题上做个标记，回来之后检查。每次考试之后别老是关注成绩，多跟以前做个对比，看看进步，多鼓励孩子……这些都是一些小细节,还有更多的小细节你可以去发现，而且这些细节都不会耽误太多的时间和精力，却能得到巨大的收获！有时候教育孩子比你想象的简单得多。外地的建工家长可以把这些方法告诉孩子的爷爷奶奶，他们肯定疼爱孩子，只是没有途径，多跟孩子爷爷奶奶交流，定期询问近况，多给孩子一些信心。<br/>      你对孩子最大的教育就是品德<br/>      上梁端正，下梁挺直。父母对孩子影响最深的方面还是言行举止。想要孩子具有良好的品格，首先要从自己做起。孩子学习我们教不了，但这方面却可以。从小对孩子在尊师重道，孝敬长辈方面言传身教，这对孩子养成优秀的道德品质至关重要。我们可以为了家和孩子在工地上埋头苦干，可以为了家和孩子努力学习施工技巧，为什么不能为了家和孩子，每天抽出点时间对孩子言传身教？这些都不是难事，而且我们建筑工兄弟本身就是具有良好品格的群体，淳厚质朴，为了家庭吃苦耐劳，勇于担当。在孩子的品德教育方面具有很大的先天优势，完全有能力尽到这部分责任。<br/>      <br/>      许多建工家长一谈子女教育就愁云惨淡，其实这不是一件很难的事。每一位父母都深爱自己的孩子，哪怕有些方面能力不够也是可以有解决的途径。在孩子教育问题上，我们的做的还有很多很多。建遇良才秉承努力服务广大建筑工兄弟的原则，持续关注大家在子女教育方面遇到的问题，与大家分享孩子教育的经验。<br/>      <br/>      ', '[{\"litpic\":false,\"height\":0,\"width\":0}]', '', '北京市', '1455957911', '0', '2', 'http://');
